Basisdaten_Register.Gegenstand_oder_Geschaeftszweck:
a) die Unternehmensberatung, insbesondere die Beratung zur Gestaltung von Unternehmens-Steuerungssystemen, Organisationsstrukturen und Organisationsabläufen sowie des Einsatzes elektronischer Datenverarbeitung;
b) die Durchführung von betriebswirtschafltichen Prüfungen und Schwachstellenanalysen mit Schwerpunkten: Finanzierung, Liquidität, Wirtschaftlichkeit, Rationalisierungspotential;
c) Unterstützung beim Einsatz elektronischer Datenverarbeitung (Hard- und Software-Bestimmung, Erstellung von Programmen, Implementierungsunterstützung und Schulung).
